column8:
・Surface Pro 3の液晶画面を衝撃に強く透過率の高いガラス製の
 スクリーンプロテクターが守ります。
・指紋や汚れが付きにくく、サッと拭き取れる特殊表面加工。
・通常の保護フィルムに比べても気泡が入りにくく、貼りやすい仕様です。
・ガラス基材は旭硝子社のガラスを使用しています。
・万が一割れても、破片が飛散したり指に刺さったりしないよう、
 特殊なフィルムで飛散防止処理されております。
・端面にはラウンドエッジ加工を施しています。
【ワケあり品　パッケージに汚れ、破損等あり。商品は新品】<br>
●送料無料 代引及び配達日時指定不可 ゆうパケット限定発送●<br><!--ポイント背景-->

